import json
import pandas as pd
import numpy as np

# Load the climateMeasurements.xlsx file and extract the Potassium values
def load_climate_measurements(file_path):
    try:
        climate_measurements = pd.read_excel(file_path)
        return climate_measurements
    except Exception as e:
        print(f"Error loading climate measurements: {e}")

# Load the radiocarbon_database_regional.xlsx file and extract the time periods when people were recorded in the Maltese area
def load_radiocarbon_database(file_path):
    try:
        radiocarbon_database = pd.read_excel(file_path)
        return radiocarbon_database
    except Exception as e:
        print(f"Error loading radiocarbon database: {e}")

# Find the first and last time periods when people were recorded in the Maltese area
def find_first_last_time_periods(radiocarbon_database):
    try:
        time_periods = radiocarbon_database.get('Time Period')
        if time_periods is None:
            print("Error: 'Time Period' column not found in radiocarbon database.")
            return None
        first_time_period = time_periods.min()
        last_time_period = time_periods.max()
        return first_time_period, last_time_period
    except Exception as e:
        print(f"Error finding first and last time periods: {e}")
        return None

# Interpolate the Potassium values between samples and calculate the average Potassium in ppm for the first and last time periods
def interpolate_potassium(climate_measurements, first_time_period, last_time_period):
    try:
        potassium_values = climate_measurements['Potassium']
        time_values = climate_measurements['Time']

        # Simple linear interpolation
        interpolated_potassium = []
        for time in [first_time_period, last_time_period]:
            if time < time_values.min() or time > time_values.max():
                interpolated_potassium.append(np.nan)
            else:
                idx = np.where(time_values <= time)[0][-1]
                if time == time_values[idx]:
                    interpolated_potassium.append(potassium_values[idx])
                else:
                    slope = (potassium_values[idx+1] - potassium_values[idx]) / (time_values[idx+1] - time_values[idx])
                    interpolated_potassium.append(potassium_values[idx] + slope * (time - time_values[idx]))

        average_potassium = np.mean(interpolated_potassium)
        return round(average_potassium, 4)
    except Exception as e:
        print(f"Error interpolating potassium values: {e}")

# Main task
def main_task():
    climate_measurements_file_path = '/orcd/home/002/gerarvit/Kramabench/data/archeology/input/climateMeasurements.xlsx'
    radiocarbon_database_file_path = '/orcd/home/002/gerarvit/Kramabench/data/archeology/input/radiocarbon_database_regional.xlsx'

    climate_measurements = load_climate_measurements(climate_measurements_file_path)
    radiocarbon_database = load_radiocarbon_database(radiocarbon_database_file_path)

    time_periods = find_first_last_time_periods(radiocarbon_database)
    if time_periods is not None:
        first_time_period, last_time_period = time_periods
        average_potassium = interpolate_potassium(climate_measurements, first_time_period, last_time_period)
        print(json.dumps({
            "subtask-1": "Loaded climate measurements",
            "subtask-2": "Loaded radiocarbon database",
            "subtask-3": "Found first and last time periods",
            "subtask-4": "Interpolated potassium values",
            "main-task": average_potassium
        }, indent=4))
    else:
        print(json.dumps({
            "subtask-1": "Loaded climate measurements",
            "subtask-2": "Loaded radiocarbon database",
            "subtask-3": "Error finding first and last time periods",
            "subtask-4": "Error interpolating potassium values",
            "main-task": "Error calculating average potassium"
        }, indent=4))

if __name__ == "__main__":
    main_task()

