import pandas as pd

# Load the climate measurements data
def load_data(file_path):
    try:
        data = pd.read_excel(file_path)
        return data
    except Exception as e:
        print(f"Error loading data: {e}")

# Identify rows that must be cleaned
def identify_rows_to_clean(data):
    # Check for missing values
    missing_values = data.isnull().sum()
    rows_with_missing_values = data[data.isnull().any(axis=1)].index.tolist()

    # Check for inconsistent data types
    inconsistent_data_types = []
    for column in data.columns:
        if data[column].dtype == 'object':
            try:
                data[column] = pd.to_numeric(data[column])
            except ValueError:
                inconsistent_data_types.append(column)

    rows_to_clean = rows_with_missing_values
    return rows_to_clean

# Calculate the percent of years the wet-dry index was increasing
def calculate_percent_increasing(data, rows_to_clean):
    # Remove rows that must be cleaned
    cleaned_data = data.drop(rows_to_clean)

    # Calculate the percent of years the wet-dry index was increasing
    if 'wet_dry_index' in cleaned_data.columns:
        wet_dry_index = cleaned_data['wet_dry_index']
        increasing_years = wet_dry_index[wet_dry_index > 0].count()
        total_years = len(wet_dry_index)
        percent_increasing = (increasing_years / total_years) * 100
        return round(percent_increasing, 2)
    else:
        return None

# Main function
def main():
    file_path = '/orcd/home/002/gerarvit/Kramabench/data/archeology/input/climateMeasurements.xlsx'
    data = load_data(file_path)
    rows_to_clean = identify_rows_to_clean(data)
    percent_increasing = calculate_percent_increasing(data, rows_to_clean)

    print(json.dumps({
        "subtask-1": "The climateMeasurements.xlsx file was loaded successfully.",
        "subtask-2": f"The rows that must be cleaned are: {rows_to_clean}",
        "subtask-2-1": "Missing values were handled by removing the rows with missing values.",
        "subtask-2-2": "Inconsistent data types were handled by converting the columns to numeric values.",
        "subtask-3": f"The percent of years the wet-dry index was increasing is: {percent_increasing}%",
        "main-task": f"The final answer is: {percent_increasing}%"
    }, indent=4))

if __name__ == "__main__":
    main()

