# Sort the data by years and calculate the difference in wet-dry index
def sort_and_calculate_diff(data):
    try:
        data['Year'] = pd.to_numeric(data['Year'], errors='coerce')
        data = data.sort_values(by='Year')
        data['Wet-Dry Index Diff'] = data['Wet-Dry Index'].diff()
        return data
    except Exception as e:
        print(f"Error sorting and calculating difference: {e}")

# Mark the years where the wet-dry index increased
