def find_row(data, dust_proxy_column, wet_dry_index_column, calcium_ppm_column):
    try:
        # Check if the columns exist in the DataFrame
        if dust_proxy_column not in data.columns or wet_dry_index_column not in data.columns:
            print(f"Error finding row: One or more columns do not exist in the DataFrame")
