        min_wet_dry_index = data.loc[data[dust_proxy_column] == min_dust_proxy, wet_dry_index_column].min()
        row = data.loc[(data[dust_proxy_column] == min_dust_proxy) & (data[wet_dry_index_column] == min_wet_dry_index), :]

