import pandas as pd
import json
import re

# Load the conflict_brecke.csv file into a pandas DataFrame
def load_data(file_path):
    try:
        data = pd.read_csv(file_path)
        return data
    except Exception as e:
        print(f"Error loading data: {e}")

# Extract the Conflict column from the DataFrame and process it to extract the pairs of countries involved in conflicts
def extract_conflicts(data):
    conflicts = data['Conflict']
    conflict_pairs = []
    for conflict in conflicts:
        # Use regular expression to extract the countries involved in the conflict
        match = re.match(r'(.*)-(.*)', conflict)
        if match:
            country1 = match.group(1).strip()
            country2 = match.group(2).strip()
            conflict_pairs.append((country1, country2))
        else:
            # If the conflict is a civil war, consider the same country as both sides of the conflict
            match = re.match(r'(.*) \((.*)\)', conflict)
            if match:
                country = match.group(1).strip()
                conflict_pairs.append((country, country))
            else:
                # If the conflict is not a civil war and does not involve two countries, ignore it
                continue
    return conflict_pairs

# Filter out conflicts that do not last at least a year
def filter_conflicts(data, conflict_pairs):
    filtered_conflicts = []
    for i, conflict in enumerate(conflict_pairs):
        start_year = data['StartYear'].iloc[i]
        end_year = data['EndYear'].iloc[i]
        if end_year - start_year >= 1:
            filtered_conflicts.append(conflict)
    return filtered_conflicts

# Count the number of human conflicts between 800 and 1400 AD and attribute them to modern countries
def count_conflicts(data, filtered_conflicts):
    conflict_count = 0
    modern_countries = {}
    for i, conflict in enumerate(filtered_conflicts):
        start_year = data['StartYear'].iloc[i]
        if 800 <= start_year <= 1400:
            conflict_count += 1
            country1, country2 = conflict
            if country1 not in modern_countries:
                modern_countries[country1] = 0
            if country2 not in modern_countries:
                modern_countries[country2] = 0
            modern_countries[country1] += 1
            modern_countries[country2] += 1
    return conflict_count, modern_countries

# Main function
def main():
    file_path = '/orcd/home/002/gerarvit/Kramabench/data/archeology/input/conflict_brecke.csv'
    data = load_data(file_path)
    conflict_pairs = extract_conflicts(data)
    filtered_conflicts = filter_conflicts(data, conflict_pairs)
    conflict_count, modern_countries = count_conflicts(data, filtered_conflicts)
    print(json.dumps({
        "main-task": {
            "conflict_count": conflict_count,
            "modern_countries": modern_countries
        }
    }, indent=4))

if __name__ == "__main__":
    main()
